import React from "react";
import { Text, Box, Accordion } from "@mantine/core";
import { IconX } from "@tabler/icons-react";
import CustomizeCategoryList1 from "./CustomizeCategoryList1";
import Settings from "./Settings";

const CategoryCustomize = ({ categoryListBoxVisible }) => {

  return (

    <Drawer
        title="Settings Drawer"
        opened={isSettingsDrawerOpen}
        onClose={() => setIsSettingsDrawerOpen(false)}
        position="left"
        size={300}
        transitionProps={{
          // transition: "scale-x",
          transition: "scale-y",
          duration: 500,
          timingFunction: "linear",
        }}
      >
        <div>
          <h3>Settings Drawer Content</h3>
        </div>
      </Drawer>
    
  );
};

export default CategoryCustomize;
